import React from 'react';
import Sidebar from '../components/Sidebar';
import { Routes, Route, Navigate } from 'react-router-dom';
import SecurityVisitors from './security/SecurityVisitors';
import NoticesPage from './shared/NoticesPage';
import SecretaryComplaints from './secretary/SecretaryComplaints'; // reuse complaints page for security

export default function SecurityDashboard() {
  const links = [
    { to: '/security/notices', name: 'Notices' },
    { to: '/security/visitor-log', name: 'Visitor Log' },
    { to: '/security/complaints', name: 'Complaints' },
  ];

  return (
    <div className="app-layout">
      <Sidebar links={links} />
      <div className="content">
        <Routes>
          <Route path="/" element={<h2>Welcome Security Guard</h2>} />
          <Route path="notices" element={<NoticesPage />} />
          <Route path="visitor-log" element={<SecurityVisitors />} />
          <Route path="complaints" element={<SecretaryComplaints />} />
          <Route path="*" element={<Navigate to="/security" replace />} />
        </Routes>
      </div>
    </div>
  );
}
